import React,{Component} from 'react'
import axios from 'axios'
class Signup extends Component
{
	constructor()
	{
		super()
		this.state={
			name:'',
			roll:0,
			mail:'',
			mob:0,
			year:2000,
			branch:'CSE',
		}
	}
	nameChange=(event)=>{
		this.setState({
			name:event.target.value
		})
	}
	rollChange=(event)=>{
		this.setState(
		{
			roll:event.target.value
		})
	}
	mailChange=(event)=>{
		this.setState({
			mail:event.target.value
		})
	}
	branchChange=(event)=>{
		this.setState({
			branch:event.target.value
		})
	}
	mobChange=(event)=>{
		this.setState({
			mob:event.target.value
		})
	}
	yearChange=(event)=>{
		this.setState({
			year:event.target.value
		})
	}
	submit=async (event)=>
	{
		event.preventDefault();
		console.log(this.state);
		await axios.post('http://localhost:8080/users/',this.state)
		.then((data)=>
		{console.log("sent"+data+this.state) 
		this.props.history.push('/')
		})
		.catch((err)=>console.log("oh"+err))
	}
	render()
	{
		return (
			<div>
			<h1>Signup</h1>
			<form onSubmit={this.submit} method="Post">
				Name : <input type="text" value={this.state.name} onChange={this.nameChange}/><br/>
				Roll no. :<input type="number" value={this.state.roll} onChange={this.rollChange}/><br/>
				Email :<input type="email" value={this.state.mail} onChange={this.mailChange}/><br/>
				Mob. No: <input type="number" value={this.state.mob} onChange={this.mobChange}/><br/>
				Graduation Year <input type="number" value={this.state.year} onChange={this.yearChange}/><br/>
				<select value={this.state.branch} onChange={this.branchChange}>
					<option value='CSE'>CSE</option>
					<option value='ME'>ME</option>
					<option value='CE'>CE</option>
					<option value='EE'>EE</option>
					<option value='ECE'>ECE</option>
				</select><br/>
				<button type="Submit">Submit</button>
			</form>

		</div>
			)

	}
}
export default Signup
